import React, {useState, useEffect} from "react";

const Data = () => {
    const artist_mbid = "ef2686fe-0bdf-4e0c-b902-cc6609acc95d";
    const url = "https://labs.api.listenbrainz.org/similar-artists/json"
    + "?algorithm=session_based_days_7500_session_300_contribution_5_threshold_10_limit_100_filter_True_skip_30&artist_mbid="+artist_mbid;
    const [similarArtists, setSimilarArtists] = useState([]);

    const fetchData = () => {
        fetch(url)
        .then((response) => response.json())
        .then((data) => setSimilarArtists(data));
    }

    useEffect(() => {
        fetchData();
    }, []);

    return (
        <div>
            <h1>Similar Artists</h1>
            <ul>
                {similarArtists.map((artist) => (
                    <li key={artist.id}>{artist.name}</li>
                ))}
            </ul>
        </div>
    );
};

export default Data;
